var _ = require('lodash'); // returns data broken up into categories for a sidebar


function readCategories(sidebar, allMetadata, languages) {
  var allCategories = {}; // Go through each language that might be defined.

  languages.filter(function (lang) {
    return lang.enabled;
  }).map(function (lang) {
    return lang.tag;
  }).forEach(function (language) {
    // Get all related metadata for the current sidebar and specific to the language.
    var metadatas = Object.values(allMetadata).filter(function (metadata) {
      return metadata.sidebar === sidebar && metadata.language === language;
    }).sort(function (a, b) {
      return a.order - b.order;
    }); // Define the correct order of categories.

    var sortedCategories = _.uniq(metadatas.map(function (metadata) {
      return metadata.category;
    }));

    var metadatasGroupedByCategory = _.chain(metadatas).groupBy(function (metadata) {
      return metadata.category;
    }).mapValues(function (categoryItems) {
      // Process subcategories.
      var metadatasGroupedBySubcategory = _.groupBy(categoryItems, function (item) {
        return item.subcategory;
      });

      var result = [];
      var seenSubcategories = new Set(); // categoryItems can be links or subcategories. Handle separately.

      categoryItems.forEach(function (item) {
        // Has no subcategory.
        if (item.subcategory == null) {
          result.push({
            type: 'LINK',
            item: item
          });
          return;
        }

        var subcategory = item.subcategory; // Subcategory has been processed, we can skip it.

        if (seenSubcategories.has(subcategory)) {
          return;
        }

        seenSubcategories.add(subcategory);
        var subcategoryLinks = metadatasGroupedBySubcategory[subcategory].map(function (subcategoryItem) {
          return {
            type: 'LINK',
            item: subcategoryItem
          };
        });
        result.push({
          type: 'SUBCATEGORY',
          title: subcategory,
          children: subcategoryLinks
        });
      });
      return result;
    }).value();

    var categories = sortedCategories.map(function (category) {
      return {
